The first ever Code Club book is here! With it, you&rsquo;ll learn how to code using Scratch, the block-based programming language. In each chapter you&rsquo;ll find instructions to build cool games, animations, and interactive stories. Your friendly robot guide will aid you step-by-step through each project and give you handy tips along the way.

&lt;ul&gt;
&lt;li&gt;Learn to code using Scratch, the block-based language&lt;/li&gt;
&lt;li&gt;Follow step-by-step guides to create games and animations&lt;/li&gt;
&lt;li&gt;Use the magic glasses* to reveal secret hints&lt;/li&gt;
&lt;li&gt;The spiral binding* allows the book to lay flat&lt;/li&gt;
&lt;/ul&gt;

The Raspberry Pi is a small, clever, British-built computer that&rsquo;s packed with potential. Made using the same technology you find in a smartphone, the Raspberry Pi is designed to help you learn coding, discover how computers work, and build your own amazing things. This book was written to show you just how easy it is to get started.

Learn how to:
&lt;ul&gt;
&lt;li&gt;Set up your Raspberry Pi, install its operating system, and start using this tiny, fully functional computer.&lt;/li&gt;
&lt;li&gt;Start coding projects, with step-by-step guides using the Scratch and Python programming languages.&lt;/li&gt;
&lt;li&gt;Experiment with connecting electronic components and have fun creating amazing projects.&lt;/li&gt;
&lt;/ul&gt;

The Raspberry Pi is loved the world over by educators and makers thanks to it&rsquo;s tiny size and endless possibilities. We&rsquo;ve managed to stuff the fourth edition of the official Raspberry Pi Projects book with another 200 pages of inspiring projects, practical tutorials, and definitive reviews so you can find out why people like it so much.

&lt;ul&gt;
&lt;li&gt;Get involved with the amazing and very active Raspberry Pi community&lt;/li&gt;
&lt;li&gt;Be inspired by incredible projects made by other people&lt;/li&gt;
&lt;li&gt;Learn how to make with your Raspberry Pi with our tutorials&lt;/li&gt;
&lt;li&gt;Find out about the top kits and accessories for your Pi projects&lt;/li&gt;
&lt;li&gt;And much, much more!&lt;/li&gt;
&lt;/ul&gt;

This book is aimed at readers who are interested in software development but have very little to no prior experience.

The book doesn&rsquo;t have any new information compared to what you can find online or in other books; it has two purposes:

&lt;ol&gt;
&lt;li&gt;It includes what I think is important for software development from a large variety of topics, saving the reader from the dilemma &ldquo;what should I learn&rdquo;&lt;/li&gt;
&lt;li&gt;It collates relevant information from lots of sources in one book, saving the reader from going through several separate web sites and books&lt;/li&gt;
&lt;/ol&gt;

It aims to contain an overview of almost everything that I think is important for software developers. It doesn&rsquo;t contain everything; but it should contain enough for the reader to understand software development, and to be able to read about and understand any topic in further detail as needed.

The book focuses on teaching the core principles around software development. It uses several technologies to this goal (e.g. C, Python, JavaScript, HTML, etc.) but is not a book about the technologies themselves. The reader will learn the basics (or in some cases more) of various technologies along the way, but the focus is on building a foundation for software development.
